import React from 'react';
import NavBar from './NavBar.js';
import '../style.css';
import Footer from "./Footer"

function RegConfirmPage() {
    return (
        <React.Fragment>
            <NavBar/>
            <body>
                <div className="registration-confirmation">
                    <h1>SUCCESS!</h1>
                </div>
            </body>
            <Footer/>

        </React.Fragment>
    );
};

export default RegConfirmPage;
